import React from "react";

function Navbar(props) {
  return (
    <nav className="navbar bg-dark container">
      <div>
        <h4>Home</h4>
        <h4>Create Ad</h4>
        <h4>Ads</h4>
      </div>
    </nav>
  );
}

export default Navbar;
